def make_ic_range(nstates, rmin, rmax, energy, jz, spin, zeta):
    rs = np.linspace(rmin,rmax,nstates)
    data = get_pth_edgb_o2(1, spin, energy, jz, np.pi/2, rs, np.sqrt(zeta/(16*np.pi)))
    ics = np.zeros((nstates,6))
    ics[:,0] = rs
    ics[:,1] = 0
    ics[:,2] = np.pi/2
    ics[:,3] = data
    ics[:,4] = 0
    ics[:,5] = jz
    return(ics)